import React from "react";
import Lightbox from "react-lightbox-component";
import { bgimg2 } from "../../image/bgimg2.jpg";

export default function ImageLandingPage() {
  return (
    <div>
      <Lightbox
        images={[
          {
            src: url(
              "https://www.google.com/imgres?imgurl=https%3A%2F%2Fstatic.toiimg.com%2Fphoto%2F72975551.cms&imgrefurl=https%3A%2F%2Ftimesofindia.indiatimes.com%2Flife-style%2Fevents%2Fsurya-grahan-today-annular-solar-eclipse-2019-december-images-photos-pics-video-check-out-these-breathing-pictures-of-the-seasons-last-surya-grahan-of-26-december-2019-india%2Fphotostory%2F72975550.cms&tbnid=pTd2OIa33-6LVM&vet=12ahUKEwi8qoawqdvqAhW0nksFHfzFB-gQMygEegUIARDRAQ..i&docid=78aIM0GrmvG9rM&w=1200&h=900&q=images&ved=2ahUKEwi8qoawqdvqAhW0nksFHfzFB-gQMygEegUIARDRAQ"
            ),
            title: "image title",
            description: "image description",
          },
        ]}
      />
    </div>
  );
}
